          "title": "Learning Software Engineering During the Era of AI | Raymond Fu | TEDxCSTU",
          "description": "What happens when the future of your profession is challenged by the very technology it helped create? In this eye-opening TEDxCSTU talk, veteran technologist and entrepreneur Raymond Fu explores a provocative question: If AI can write code, is it still worth learning software engineering?\n\nDrawing from decades of experience leading innovation in the tech industry, and reflecting on his role as both a professor and the father of a future engineer, Raymond offers a bold new perspective on what it means to be a software engineer in the AI era. With real-world examples, personal insights, and a touch of humor, he explores how AI is reshaping the profession, and why human engineers are more essential than ever.\n\nThis talk presents a new framework for preparing the next generation of engineers. It goes beyond coding speed to emphasize critical thinking, system design, ethical leadership, and creative collaboration with AI.\n\nRaymond Fu is a seasoned technologist, serial entrepreneur, and computer science educator. He has led engineering teams across startups and enterprise environments, building scalable systems and mentoring young talent. Raymond’s deep industry knowledge spans software development, artificial intelligence, and the evolving human-AI partnership. As a passionate advocate for education and innovation, he continues to inspire engineers to not just adapt to AI, but to lead it.\n\nThis talk was given at a TEDx event using the TED conference format but independently organized by a local community. Learn more at http://ted.com/tedx.\n\nEvent: TEDxCSTU \nDate: May 18th, 2025\nLocation: California Science & Technology University (CSTU)\nWebsite: https://www.cstu.edu?utm_source=youtube&utm_medium=social&utm_campaign=tedx2025&utm_term=raymond_fu\n\nSpeaker: Raymond Fu\n\nLearn more about the speaker:\nhttps://www.linkedin.com/in/raymondxfu/\n\nOrganizer: Leni Jin, Organizer of TEDxCSTU\nConnect with the organizer:\nhttps://www.linkedin.com/in/lenijin/\n\n#tedxcstu2025 #TEDxTalks #ArtificialIntelligence #Innovation #PersonalGrowth Raymond Fu is a veteran technologist and serial entrepreneur with deep roots in the software industry. In this insightful talk, he tackles a critical question facing today’s workforce: How do we learn software engineering in the age of AI? With firsthand experience leading innovation across startups and tech companies, Raymond shares practical ideas on what students can do to become successful engineers and thrive in an AI-driven world. This talk was given at a TEDx event using the TED conference format but independently organized by a local community. Learn more at https://www.ted.com/tedx",
